translate:
  '=': ==
  AND: and
  DISPLAY: print
  ELSE: else
  IF: if
  INPUT: input
  LENGTH: len
  MOD: '%'
  NOT: not
  OR: or
  PROCEDURE: def
  RANDOM: randint
  RETURN: return
  "\u2190": '='
  "\u2260": '!='
  "\u2264": <=
  "\u2265": '>='
unchanged:
- +
- '-'
- '*'
- /
- '>'
- <
- (
- )
- '['
- ']'
- ','
- '"'
- ''''
uncommons:
  '!=': "\u2260"
  <-: "\u2190"
  <=: "\u2264"
  '>=': "\u2265"
